import Header from "../components/Header";
import GameCard from "../components/CameCard";

const Home = ({ games }) => {
  const renderGames = () => games.map((game) => <GameCard />);
  return (
    <div>
      <header>
        <h1>Welcome to Gamez Central</h1>
      </header>
    </div>
  );
};

export default Home;
